  \"2013-03-15T11:48:34.562171\",\n\t\"name\": \"spatial-vegetation-data-for-colorado-national-monument-vegetation-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The vegetation units on this map were determined
  through a series of image processing steps including unsupervised classification,
  ecological modeling and stereoscopic interpretation of aerial photographs supported
  by field sampling and ecological analysis. The vegetation boundaries were identified
  on the photographs by means of the photographic signature and collateral information
  on slope, hydrology, geography, and vegetation in accordance with the Standardized
  National Vegetation Classification System (October 1995). The mapped vegetation
  reflects conditions that existed during the specific year and season that the aerial
  photographs were taken. There is a margin of error inherent in the use of aerial
  photographs. Therefore, a detailed ground and historical analysis of a single site
  may result in a revision of the vegetation alliance boundaries established through
  photographic interpretation.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
